import ComponentProps from "./types";

const TodoItem = ({ data: string }) => {
  return (
    <>
      <div>
        <input type="checkbox" id={data} name={data} />
        <label htmlFor={data}>{data}</label>
      </div>
    </>
  );
};

export default TodoItem;
